import math

def find_max_prime(arr):
    maxPrime = 1
    for num in arr:
        isPrime = True
        for i in range(2, int(math.sqrt(num)) + 1):
            if num % i == 0:
                isPrime = False
                break
        if isPrime and num > maxPrime and (num > 1):
            maxPrime = num
    return maxPrime

